import Layout from '../components/layout';
import { Drawer } from '@material-ui/core';

export default function() {
  return (
    <React.Fragment>
      <Layout>
        <Drawer variant="permanent"></Drawer>
      </Layout>
    </React.Fragment>
  );
}
